DESCRIPTION:
Rašiau apie neveikiančia lempą ir gavau atsakymą:
&#34;Jūsų nurodytoje vietoje sumontuoti šviestuvai UAB Vilniaus apšvietimas nepriklauso, dėl jų remonto, įjungimo ar išjungimo prašome kreiptis į šį apšvietimo tinklą administruojančią įmonę.&#34;

Gal būtumėt malonūs ir praneštumėt tai administruojančiai įmonei apie neveikiantį apšvietimą? Aš matau mieste problemą ir apie ją pranešų, nes tikrai nežinau kas kur ką administruoja. Kaip suprantu šitos progamėlės ir esmė, registruoti problemas vienoje vietoje, o jau Jūs ten pasiskirstot kas ką tvarko. Jau ne pirmą kartą gaunu tokį atsifutbolinantį atsakymą, kuris visiškai nepadeda išspręsti problemos.
